import React, { useState } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';

const AddUser = () => {
  const [state, setState] = useState({
    id: "",
    name: "",
    email: "",
    gender: "",
    status: ""
  });

  const { id, name, email, gender, status } = state;
  return (
    <div>
      <h2>Add New User</h2>
      <Box
        component="form"
        sx={{
          marginTop: 30,
          '& > :not(style)': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
      >
        <TextField id="outlined-basic" label="ID" variant="outlined" value={id} type="number"/>
        <br />
        <TextField id="outlined-basic" label="Name" variant="outlined" value={name} type="text"/>
        <br />
        <TextField id="outlined-basic" label="Email" variant="outlined" value={email} type="email"/>
        <br />
        <TextField id="outlined-basic" label="Gender" variant="outlined" value={gender} type="text"/>
        <br />
        <TextField id="outlined-basic" label="Status" variant="outlined" value={status} type="text"/>
        <br />
        <Button variant="contained" color="primary" type="submit">Submit</Button>
      </Box>
    </div>
  )
}

export default AddUser;
